'use client';

import { useEffect } from 'react';
import anime from 'animejs';

import { cn } from '@/lib/utils';

type TabooAILoadingEffectProps = {
  className?: string;
};

export function TabooAILoadingEffect(props: TabooAILoadingEffectProps) {
  useEffect(() => {
    anime({
      targets: '#taboo-ai-logo-svg-stroke path',
      strokeDashoffset: [0, anime.setDashoffset],
      easing: 'easeInOutSine',
      duration: 1000,
      delay: function (el, i) {
        return i * 500;
      },
      direction: 'reverse',
      loop: true,
    });
    anime({
      targets: '#taboo-ai-logo-svg-backdrop path',
      strokeDashoffset: [0, anime.setDashoffset],
      easing: 'easeInOutSine',
      duration: 1000,
      delay: function (el, i) {
        return i * 500;
      },
      direction: 'reverse',
      loop: true,
    });
  }, []);

  return (
    <div className={cn('relative h-[53px] w-[265px]', props.className)}>
      <TabooAILogoSvgStroke />
      <TabooAILogoSvgBackdrop />
    </div>
  );
}

